import React from "react";
import { Container, Row, Col, Button, NavDropdown } from "react-bootstrap";

class ProjectForm extends React.Component {
  render() {
    return (
      <div
        className='Container'
        style={{
          height: "100%",
          color: "orange",
          marginTop: "100px",
          backgroundColor: "red"
        }}
      >
        Project Form
      </div>
    );
  }
}
export default ProjectForm;
